import PropTypes from 'prop-types'
import classNames from 'classnames'

const Terms = props => {
  const { toggleCheckTerms, terms, grayText } = props
  return (
    <div className='flex-center'>
      <input
        type='checkbox'
        name='terms'
        value={terms}
        onChange={toggleCheckTerms}
        checked={terms}
      />
      <span
        className={classNames(
          'register__form-terms synchronization--margin-left',
          {
            'register__form-terms--gray': grayText
          }
        )}
      >
        Acepto el{' '}
        <a
          className='register__form-terms-link'
          href='https://app.enconta.com/acerca-de/privacidad'
          target='_blank'
        >
          Aviso de Privacidad
        </a>{' '}
        y los{' '}
        <a
          className='register__form-terms-link'
          href='https://app.enconta.com/acerca-de/terminos-y-condiciones'
          target='_blank'
        >
          TÃ©rminos y Condiciones
        </a>
      </span>
    </div>
  )
}

export default Terms

Terms.propTypes = {
  terms: PropTypes.bool.isRequired,
  toggleCheckTerms: PropTypes.func.isRequired,
  grayText: PropTypes.bool
}

Terms.defaultProps = {
  terms: false,
  toggleCheckTerms: () => {},
  grayText: false
}
